// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./IUser.sol";

contract Marketplace {
    enum AdStatusEnum{
        Canceled,Sold,Live 
    }
    
    struct Ad{
        uint id;
        address _consumer;
        string houseAddress;
        uint demandUnits;
        uint arrangedUnits;
        uint pricePerUnit;
        AdStatusEnum status;
    }
    
    IUser iUser;
    mapping(uint => Ad) public Ads;
    
    address public owner;
    IUser public userRegistery;
    uint id=1;

    constructor(IUser _userRegistory) {
        owner = msg.sender;
        userRegistery = _userRegistory;
        // userRegistery.shiftOwnerShip(address(this));
    }
    
    modifier onlyOwner() {
        require(msg.sender == owner, "Caller is not the owner");
        _;
    }


    /* Place the ad in marketplace and update the Producer account*/
    function addAd(string memory houseAddress, uint demandUnits, uint pricePerUnit) external {
        require(userRegistery.isValidUser(msg.sender),"User has not registered yet. Register the account");
        require(userRegistery.isValidUserHouse(msg.sender,houseAddress),"House is not registered.");
        userRegistery.deductUnits(msg.sender,houseAddress,demandUnits);
        
        Ads[id] = Ad({
            id: id++,
            _consumer: msg.sender,
            houseAddress: houseAddress,
            demandUnits: demandUnits,
            arrangedUnits: 0,
            pricePerUnit:pricePerUnit,
            status :AdStatusEnum.Live
        });
    }

    /* Cancel the ad from marketplace and update the Producer account*/
    function cancelAd(uint adId) public {
        require(Ads[adId]._consumer==msg.sender,"Ad doesn't link with provided user");
        
        Ad storage ad= Ads[adId];
        userRegistery.widthrawalUnitsFromOrder(msg.sender, ad.houseAddress ,ad.demandUnits);

        ad.status=AdStatusEnum.Canceled;
    }


    //                  Orders
    struct  Order{
        uint orderId;
        address _consumer;
        address _producer;
        uint discountPercentage;
        uint numOfUnits;
        string _consumerHouse;
    }
    mapping(uint=>Order) orders;
    uint orderCount;
    
    function order(uint adId, uint numOfUnitPurchase, string memory transferAtHouseAddr,uint couponNum) public {
        require(userRegistery.isValidUser(msg.sender),"User has not registered yet. Register the account");
        require(userRegistery.isValidUserHouse(msg.sender,transferAtHouseAddr),"House is not registered.");
        require(Ads[adId].id != 0 ,"Ad Doesn't Exist");
        require(Ads[adId].status!=AdStatusEnum.Canceled  || Ads[adId].status!=AdStatusEnum.Sold,"Ad Doesn't Exist");
        require(Ads[adId].demandUnits - Ads[adId].arrangedUnits  >= numOfUnitPurchase 
        ,"Number of unit want to purchase exceed from the Ad limit");
        Ad storage ad = Ads[adId];
        uint discount = 0;
        
        require(userRegistery.doesUserHaveCoupon(msg.sender,couponNum),"Doesn't Have Coupon to avail discount");
        discount = userRegistery.availDiscount(msg.sender,couponNum);
        
        
        ad.arrangedUnits += numOfUnitPurchase; // Update Ad's sold units

        orders[orderCount++] = Order({
            orderId:orderCount,
            _consumer: ad._consumer,
            _producer: msg.sender,
            discountPercentage: discount,
            numOfUnits: numOfUnitPurchase, 
            _consumerHouse:transferAtHouseAddr
        });
    }
}

