// SPDX-License-Identifier: MIT
pragma solidity >=0.8.0;

import "./IUser.sol";
import "./MarketPlace.sol";

import {Ownable} from "@openzeppelin/contracts/access/Ownable.sol";

contract  UserRegistery is IUser, Ownable {
    enum CouponsEnum {
        Coupon2,
        Coupon5,
        Coupon10
    }

    //                               Structures
    struct Couponse {
        CouponsEnum name;
        uint8 disc;
        uint8 numOfCoupons;
    }
   
    struct House{
        string houseAddress;
        uint256 powerUnits;
    }

    struct User { // add the machine's company account as an admn to approve the listing
        address walletAddress;
        mapping(CouponsEnum => Couponse) personal_Couponse;
        uint32 loyalityPoints;
        mapping(string => House) houses;
    }

    //                               Global Variables
    mapping(address => User) public Users;



    //                               Modifiers
    // modifier onlyOwner() {
    //     require(msg.sender == owner, "Caller is not the owner");
    //     _;
    // }
 
 
    function doExist(address addr,string memory houseAddress) public view returns(bool){
        require(Users[addr].walletAddress != address(0), "User doesn't exist");
        return bytes(Users[addr].houses[houseAddress].houseAddress).length != 0;
    }

    function isValidUser(address addr) onlyOwner external view returns(bool) {
        return Users[addr].walletAddress != address(0);
    }
    
    function isValidUserHouse(address addr,string memory houseAddr) external onlyOwner view returns(bool) {
        return bytes(Users[addr].houses[houseAddr].houseAddress).length!=0;
    }

    //                               Constructor
    constructor() Ownable(msg.sender) {
    }

    //                               Functions
    function registerUser() public {
        require(Users[msg.sender].walletAddress == address(0), "User is already Registered");
        User storage user = Users[msg.sender];
        user.walletAddress = msg.sender;
        user.loyalityPoints = 0;
    }

    function registerNewHouse(string memory houseAddr) public {
        require(Users[msg.sender].walletAddress != address(0),"User is not register");
        require(bytes(Users[msg.sender].houses[houseAddr].houseAddress).length == 0,"House is Already exists");

        Users[msg.sender].houses[houseAddr] = House({
             houseAddress:houseAddr, // shift to the web 2 database side
            powerUnits:0
        });
    }
    
    /* Deposit the units in the user account*/
    function depositUnits(string calldata homeAddress, uint256 noOfUnits) public {
        require(bytes(Users[msg.sender].houses[homeAddress].houseAddress).length >= 0,"House is not Registered");
        require(noOfUnits > 0, "No of Units must be greater than 1.");

        User storage user = Users[msg.sender];
        
        user.houses[homeAddress].powerUnits+=noOfUnits;
    }

    function buyCoupons(CouponsEnum couponName) public    {
        User storage user = Users[msg.sender];

        uint8 disc = 0;
        if (couponName == CouponsEnum.Coupon2) {
            disc = 2;
        } else if (couponName == CouponsEnum.Coupon5) {
            disc = 5;
        } else if (couponName == CouponsEnum.Coupon10) {
            disc = 10;
        }
        require(user.loyalityPoints > disc*10,"Dont have enough points to buy");
        user.loyalityPoints -= disc*10;
        user.personal_Couponse[couponName] =  Couponse({name: couponName, disc: disc, numOfCoupons: 1});
    }

    /* Withdarwal the units in the  */
    function withdrawalUnits(string calldata houseAddress, uint256 noOfUnits)  public {
        require(Users[msg.sender].walletAddress != address(0), "User doesn't Exist.");
        require(noOfUnits > 0, "No of Units must be greater than 1.");

        User storage user = Users[msg.sender]; // find user on address
        user.houses[houseAddress].powerUnits += noOfUnits; // update their units

        user.loyalityPoints += uint32(noOfUnits); // Give loyality points
    }

    function getAllUserCoupons() public view returns (Couponse[] memory) {
        Couponse[] memory allCoupons = new Couponse[](3); // Assuming 3 types of coupons
        
        allCoupons[uint(CouponsEnum.Coupon2)] = Users[msg.sender].personal_Couponse[CouponsEnum.Coupon2];
        allCoupons[uint(CouponsEnum.Coupon5)] = Users[msg.sender].personal_Couponse[CouponsEnum.Coupon5];
        allCoupons[uint(CouponsEnum.Coupon10)] = Users[msg.sender].personal_Couponse[CouponsEnum.Coupon10];
        
        return allCoupons;
    }

    function getUserHouse(string memory houseAddr)  public view returns(House memory)  {
        require(Users[msg.sender].walletAddress != address(0),"User doesn't Exist");
        require(bytes(Users[msg.sender].houses[houseAddr].houseAddress).length>0,"House doesn't Exist");
        return Users[msg.sender].houses[houseAddr];
    }
    

    //                          Owner's Functions
    function deductUnits(address userAdd,string memory houseAddress,uint numOfUnits) external override onlyOwner  {
        require(Users[msg.sender].walletAddress != address(0), "User does't Exist");
        require(bytes(Users[msg.sender].houses[houseAddress].houseAddress).length>0,"House doesn't exist");
        require(Users[userAdd].houses[houseAddress].powerUnits >= numOfUnits,"User should have power units in their account.");
        Users[userAdd].houses[houseAddress].powerUnits -= numOfUnits;
    }
    function widthrawalUnitsFromOrder(address userAdd,string memory houseAddress,uint numOfUnits) external override onlyOwner {
        require(Users[msg.sender].walletAddress != address(0), "User does't Exist");
        require(bytes(Users[msg.sender].houses[houseAddress].houseAddress).length>0,"House doesn't exist");
        require(Users[userAdd].houses[houseAddress].powerUnits >= numOfUnits,"User should have power units in their account.");
        Users[userAdd].houses[houseAddress].powerUnits += numOfUnits;
    }
    function doesUserHaveCoupon(address user,uint couponEnum) external override view returns(bool){
        CouponsEnum coupon = CouponsEnum(couponEnum);
        return Users[user].personal_Couponse[coupon].numOfCoupons > 0;
    }

    function availDiscount(address user,uint couponEnum) external override  view onlyOwner returns(uint){
        CouponsEnum coupon = CouponsEnum(couponEnum);
        return Users[user].personal_Couponse[coupon].disc;
    }
}

